Changing options of packages in nixpkgs can require chaining different override functions like this: { htop-mod = let htop-overridden = pkgs.htop.overrideAttrs (old: { pname = "htop-mod"; }); in htop-overridden.override (old: { sensorsSupport = false; });
} ... while doing the same using dream2nix looks like this: { htop-mod = { imports = [./htop.nix]; name = lib.mkForce "htop-mod"; flags.sensorsSupport = false; };
} See htop module definition here .
